import React from 'react'

let style = {
    lineHeight: '5px',
    backgroundColor: 'rgba(0, 0, 0, .1)',
    borderRadius: '5px'
}

const feedItem = (props) => (
    <div style={style}>
        <p style={{lineHeight: '20px', margin: '20px 0 10px 10px'}}>
        <span>
        Plate #: {props.children}
        </span>
        <br></br>
        <span>
        Car Type: {'Blue Honda Civic'}
        </span>
        </p>
    </div> 
)

export default feedItem
